import consumer from "./consumer"

consumer.subscriptions.create("RoomChannel", {
  connected() {
    // Called when the subscription is ready for use on the server
    console.log("connected to the room......")
  },

  disconnected() {
    // Called when the subscription has been terminated by the server
    console.log("disconnected.......")
  },

  received(data) {
    // Called when there's incoming data on the websocket for this channel
    console.log("receiving dataaaaaa", data);
    console.log("dataaaaaaaa", JSON.parse(data.content));
    // var x = $('#container');
    // console.log("xxxxxxxxxxx", x);

    // console.log("data.content[0] $$$$$$$", JSON.parse(data.content)[0]);



    var headers = Object.keys(JSON.parse(data.content)[0]);
    // console.log("headersssssssss", headers);
    console.log("lengthhhhhhhhhhhh", JSON.parse(data.content).length);
    for(var i = 0; i < JSON.parse(data.content).length; i++) {
      var tr = document.createElement('tr');

        for(var j = 0; j < headers.length; j++) {
          // console.log("jjjjjjj", headers[j]);
          var td = document.createElement('td');
          // console.log("iiiiiiiii", i, " @@@@@@@ ", JSON.parse(data.content)[i]);
          try {
            // console.log("valueeeeeeee", j, " ******** ", JSON.parse(data.content)[i][headers[j]]);
            td.appendChild(document.createTextNode(JSON.parse(data.content)[i][headers[j]]));
            tr.appendChild(td)
          } catch(e) {
            console.log(i, " %%%%%% ", j, "eeeeeeee", e);
          }

        }

        // console.log("table rowwwwwwww", tr);



          $('#container').append(tr);
    }
}
})
